import React, { Component } from 'react';

export default class Admin extends Component {
  render() {
    return <div>
    	<main>
    		<form >
	            <li><label>Nom : <input type="text" name="name" /></label></li>
	            <li><label> Date de Naissance : <input type="date" name="birth" /></label></li>
	            <li><label> Nombre de followers : <input type="number" name="followers" /></label></li>
	            <li><label> Albums : <input type="search" placeholder="Entrez un mot-clef" name="clef" /></label></li>
        	</form>
    	</main>
    </div>;
  }
}
